import React, { useState } from 'react';
import {
  Box,
  Typography,
  Button,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  AppBar,
  Toolbar,
  Card,
  CardContent,
  Grid,
} from '@mui/material';
import { Dashboard, Settings, Logout, Add } from '@mui/icons-material';

const App = () => {
  const [dialogOpen, setDialogOpen] = useState(false);

  const handleAddClick = () => {
    setDialogOpen(true);
  };

  return (
    <Box sx={{ display: 'flex', minHeight: '100vh', bgcolor: '#1a237e' }}>
      {/* Sidebar */}
      <Drawer
        variant="permanent"
        sx={{
          width: 240,
          flexShrink: 0,
          [`& .MuiDrawer-paper`]: {
            width: 240,
            boxSizing: 'border-box',
            bgcolor: '#0d47a1', // Dark blue
            color: '#fff',
          },
        }}
      >
        <Toolbar />
        <List>
          <ListItem button>
            <ListItemIcon sx={{ color: '#fff' }}>
              <Dashboard />
            </ListItemIcon>
            <ListItemText primary="Dashboard" />
          </ListItem>
          <ListItem button>
            <ListItemIcon sx={{ color: '#fff' }}>
              <Settings />
            </ListItemIcon>
            <ListItemText primary="Settings" />
          </ListItem>
          <ListItem button>
            <ListItemIcon sx={{ color: '#fff' }}>
              <Logout />
            </ListItemIcon>
            <ListItemText primary="Logout" />
          </ListItem>
        </List>
      </Drawer>

      {/* Main Content */}
      <Box sx={{ flexGrow: 1, p: 3 }}>
        <AppBar
          position="fixed"
          sx={{
            width: `calc(100% - 240px)`,
            ml: '240px',
            bgcolor: '#1a237e', // Dark blue top bar
          }}
        >
          <Toolbar>
            <Typography variant="h6" noWrap component="div">
              Admin Dashboard
            </Typography>
          </Toolbar>
        </AppBar>
        <Toolbar />

        <Typography variant="h4" gutterBottom sx={{ color: '#fff' }}>
          Manage Items
        </Typography>

        {/* Add Button */}
        <Button
          variant="contained"
          startIcon={<Add />}
          onClick={handleAddClick}
          sx={{
            bgcolor: '#1565c0', // Lighter blue
            color: '#fff',
            '&:hover': {
              bgcolor: '#0d47a1', // Darker on hover
            },
            mb: 3,
          }}
        >
          Add Item
        </Button>

        {/* Items Section */}
        <Grid container spacing={3}>
          {[1, 2, 3].map((item) => (
            <Grid item xs={12} sm={6} md={4} key={item}>
              <Card
                sx={{
                  bgcolor: '#3949ab', // Cadre dark blue
                  color: '#fff',
                  borderRadius: 2,
                  boxShadow: 3,
                  '&:hover': {
                    boxShadow: 6,
                  },
                }}
              >
                <CardContent>
                  <Typography variant="h6">Item Name {item}</Typography>
                  <Typography variant="body2" color="text.secondary" sx={{ color: '#c5cae9' }}>
                    Description of the item goes here.
                  </Typography>
                  <Button
                    variant="contained"
                    sx={{
                      bgcolor: '#1565c0',
                      color: '#fff',
                      mt: 2,
                      '&:hover': { bgcolor: '#0d47a1' },
                    }}
                  >
                    View Details
                  </Button>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
};

export default App;
